import React from "react";

function Todo(props) {

    return (
        <div className='todo'>
            <span className='todo-text'>{props.todo.text}</span>
            <div className='todo-buttons'>
                <button onClick={props.onClick} className='todo__delete-button'>X</button>
                <button className='todo__edit-button'>
                    <img src='pen.svg' class='todo__edit-button-image' alt='Редактирование'/>
                </button>
            </div>
        </div>
    )
}

export default Todo
